import './App.css';
import { Header } from './components/header/header';
import { ContainerMain } from './components/container/container';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import { Login } from './components/container/login/login';
import { Estudiante } from './components/container/estudiante/estudiante';

function App() {
  return (
    <div className="App">

      {/* <Header />
      <ContainerMain /> */}
      <Router>
        <Switch>
          <Route exact path="/login" component={Login} />
          <Route path="/containers" component={ContainerMain} />
          <Route exact path="/" component={Login} />
          <Route exact path="/containers/estudiantes" component={Estudiante} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
